DROP TABLE IF EXISTS REGISTRATIONS;
DROP TABLE IF EXISTS EVENTS;
DROP TABLE IF EXISTS CUSTOMERS;

CREATE TABLE CUSTOMERS (
    id	INT NOT NULL,
    name	VARCHAR(512),
    email	VARCHAR(512) NOT NULL UNIQUE,
    password	VARCHAR(512),
    PRIMARY KEY (id)
);

CREATE TABLE EVENTS (
    id	INT NOT NULL,
    name	VARCHAR(512),
    date	timestamp,
    PRIMARY KEY (id)
);


